        built=dir(builtins)
        kwo=built+kwo
        kwo.sort()
        kwo=list(vst.variables)+kwo
        kwo=list(set(kwo))
        kwo=sorted(kwo)
        for idx in kwo:
            if  idx.startswith(k_prefix)  and k_prefix!=idx:bj=False
        if bj:
            try:
                kp_win.destroy()
            except:
                pass
            return "break"
        mt_s=[wo for wo in kwo if wo.startswith(k_prefix) and k_prefix!=wo]
