def ter(**event):
    import subprocess
    top = tk.Toplevel(root)
    top.resizable(0, 0)
    top.title("Terminal")
    input = ttkbootstrap.Entry(top)
    input.insert(tk.INSERT, "Your Command")
    input.event_generate("<<SelectAll>>")
    textbook = tk.Text(top, width=100, height=20)
    def out(e):
        com = input.get()
        try:
            outs = subprocess.check_output(com, shell=1)
            textbook.insert(tk.END, outs)
        except Exception as e:
            textbook.insert(tk.END, str(e) + "\n")
        textbook.see("end")
    top.bind("<Return>", out)
    input.pack()
    textbook.pack(fill="both",expand=True,side="left")
    tf=tkk.Scrollbar(top,orient=tk.VERTICAL)
    tf.pack(side="left",fill="y")
    tf.config(command=textbook.yview)
    textbook.config(yscrollcommand=tf.set)

